import styled from "styled-components"

export const StyledList = styled.ul`
  list-style: none;
  padding: 0;
  margin: 0;
  display: flex;
  flex-direction: column;
  flex-grow: 2;
  width: 50%;
  max-height: 70vh;
  overflow-y: scroll;
  overflow-x: hidden;
  border: 2px solid black;
  border-radius: 0.3rem;
`
